import React from 'react'

import './footer.scss'

export default function Footer() {
    const imgMoscow = props.images.find(image => image.name === "imgMoscow");

    return (
        <footer className='footer'>
            <div className="container-center">
                <div className='wrap'>
                    Follow us
                </div>
            Footer
            </div>
        </footer>
    )
}
